import React from "react";
import { useEffect } from "react";
import { useLocation } from "react-router-dom";

const CarList = () => {
  const { state } = useLocation();
  const [cars, setCars] = useState([]);

  const submitFilters = {
    make: state.make || null,
    mode: state.model || null,
    carCondition: state.carCondition || null,
    price: state.price || null,
    year: state.year || null,
  };

  useEffect(() => {
    const fetchFilteredCars = async () => {
      try {
        const response = await fetch(
          `http://localhost:8080/cars/search?model=${submitFilters.model}&make=${submitFilters.make}&price=${submitFilters.price}&year=${submitFilters.year}&carCondition=${submitFilters.carCondition}`
        );
        //http://localhost:8080/cars/search?price=22000
        if (!response.ok) {
          throw new Error("HTTP Error ! Status Code", response.status);
        }
        data = response.json();
        setCars(data);
      } catch (e) {
        console.error("Fetch Filtered Cars failed on catch", e);
      }
    };
  }, []);

  return <div></div>;
};

export default CarList;
